methods/postman.html.body:
Follow along with Postman
Postman is an app for easy RESTful API exploration. Use the Builder below to get a "Postman Collection" with a prefilled environment with your Bandwidth credentials.
Assumptions

You have downloaded Postman
You have your Voice and Messaging API userId, token, secret

Fill in the form then Click Run in Postman below to explore our V1 API Collection.


        Voice and Messaging API User Id:

        Your Voice and Messaging API User Id


        Voice and Messaging API Token:

        Your Voice and Messaging API Token


        Voice and Messaging API Secret:

        Your Voice and Messaging API Secret






 -->


function restApiPage () {
    function enableOnChange (functionName) {
        console.log('Enabling On Change for elements');

        const elements = document.getElementsByClassName("postman-env");
        for (let element of elements) {
            element.addEventListener("change", functionName, false);
            element.addEventListener("keyup", functionName, false);
            element.addEventListener("paste", functionName, false);
        }
    }

    function loadPostman () {
        console.log('loading postman');
        try {
            document.getElementById("_pmPostmanRunObject").outerHTML="";
            document.getElementById("pm-oip-overlay").outerHTML="";
        }
        catch (e) {
            console.log('Postman was not loaded');
        }
        (function (p,o,s,t,m,a,n) {
            !p[s] && (p[s] = function () { (p[t] || (p[t] = [])).push(arguments); });
            !o.getElementById(s+t) && o.getElementsByTagName("head")[0].appendChild((
              (n = o.createElement("script")),
              (n.id = s+t), (n.async = 1), (n.src = m), n
            ));
            }(window, document, "_pm", "PostmanRunObject", "https://run.pstmn.io/button.js"));
    }

    function checkRequiredVal(obj, required) {
        var result = true;
        for (var i in required) {
            if (obj[required[i]] === '') {
                result = false;
                break
            }
        }
        return result;
    }

    function updatePostmanEnv (data) {
        const success = _pm("env.replace", "Bandwidth API Keys", data);
        if (!success) {
            _pm("env.create", "Bandwidth API Keys", data);
        }
    }

    function updateRESTEnv () {
    //instead of triggering on button, do onchange (keyup, paste, enter, tab, bbrown will send all this fun stuff)
        const userId     = document.getElementById("messaging_user_id").value;
        const token      = document.getElementById("messaging_api_token").value;
        const secret     = document.getElementById("messaging_api_secret").value;
        const envData = {
          userId     : userId,
          token      : token,
          secret     : secret,
        };
        console.log(envData);
        //INstead of creating, replace. will need update collection to contain default empty enviornment
        if (checkRequiredVal(envData, ["userId", "token", "secret"])) {
            console.log('All set, updating postman');
            updatePostmanEnv(envData);
            document.getElementById("postman-container").removeAttribute("style");
        }
        else {
            console.log('Nothing yet');
            updatePostmanEnv(envData);
            document.getElementById("postman-container").setAttribute("style", "pointer-events: none; opacity: 0.5;");
        }
    }

    loadPostman();
    enableOnChange(updateRESTEnv);
};

restApiPage();

methods/account/getAccount.html.body:
Fetch Account Information
Get information about user account.
Request URL:
GEThttps://api.catapult.inetwork.com/v1/users/{{userId}}/account

Account Properties



PROPERTY
DESCRIPTION




balance
Your account balance in dollars, as a string; the currency symbol is not included.


accountType
The type of account configured for your user:  - pre-pay: the type of account where you increase your available balance with credit card payments.  - post-pay: the type of account where you have signed a contract and will receive a monthly bill detailing usage



Get an Account object. No query parameters are supported.
curl -v -X GET  https://api.catapult.inetwork.com/v1/users/{{userId}}/account -u {{apiToken}}:{{apiSecret}} -H "Content-type: application/json"

// Promise
client.Account.get().then(function(info){});

// Callback
client.Account.get(function(err, info){});

var account = await client.Account.GetAsync();
Console.WriteLine(account.Balance);
// 538.37250

account = Bandwidth::Account.get(client)
balance = account[:balance]


The above command returns JSON structured like this:

{
    "balance": "538.37250",
    "accountType": "pre-pay"
}

methods/account/getAccountTransactions.h.body:
Fetch Account Transactions
Get the transactions from the user's account.
Request Url
GEThttps://api.catapult.inetwork.com/v1/users/{userId}/account/transactions

Query Parameters



Parameter
Description
Mandatory




maxItems
Limit the number of transactions that will be returned.
No


fromDate
Return only transactions that are newer than the parameter. Format: "yyyy-MM-dd'T'HH:mm:ssZ"
No


toDate
Return only transactions that are older than the parameter. Format: "yyyy-MM-dd'T'HH:mm:ssZ"
No


type
Return only transactions that are this type.
No


page
Used for pagination to indicate the page requested for querying a list of transactions. If no value is specified the default is 0.
No


size
Used for pagination to indicate the size of each page requested for querying a list of transactions. If no value is specified the default value is 25 (maximum value 1000).
No


number
Return only transactions that are from the specified number.
No



Transaction Properties



PROPERTY
DESCRIPTION




id
The unique identifier for the transaction.


time
The time the transaction was processed.


amount
The transaction amount in dollars, as a string; the currency symbol is not included.


type
The type of transaction.


units
The number of product units the transaction charged or credited.


productType
The product the transaction was related to (not all transactions are related to a product).


number
The phone number the transaction was related to (not all transactions are related to a phone number).



Transaction Types



TYPE
DESCRIPTION




charge
A charge for the use of a service or resource (for example, phone calls, SMS messages, phone numbers).


payment
A payment you made to increase your account balance.


credit
An increase to your account balance that you did not pay for (for example, an initial account credit or promotion).


auto-recharge
An automated payment made to keep your account balance above the minimum balance you configured.



Product Types



Type
Description




local-number-per-month
The monthly charge for a local phone number.


toll-free-number-per-month
The monthly charge for a toll-free phone number.


sms-in
A SMS message that came in to one of your numbers.


sms-out
A SMS message that was sent outbound one of your numbers.


mms-in
A MMS message that was sent to one of your numbers.


mms-out
A MMS message that was sent outbound one of your numbers.


call-in
An inbound phone call to one of your numbers.


call-out
An outbound phone call that was created by your app.


sip-call-in
A phone call that came inbound via SIP to one of your registered endpoints.


sip-call-out
A phone call made outbound to a SIP address.


transcription
A transcription of a recorded call.


cnam-search
A CNAM lookup request for a phone number.



