    bridgeAudio: true
})
.then(function (bridgeId) {
    return client.Call.create({
        from: "{fromNumber}",
        to: "{sip:someone@somewhere.com}",
        bridgeId: bridgeId.id
    })
})
.then(function (callId) {
    console.log(callId);
