Parameter
Description
Mandatory




state
The call state. Possible values:  rejected to reject the incoming call active to answer the incoming callcompleted to hangup the active calltransferring to transfer the incoming call to another line. See the docs specific for transferring
No


recordingEnabled
Indicates if the call should be recorded. Values true or false. You can turn recording on/off and have multiple recordings on a single call.
