Supported Parameters



Parameter
Description
Mandatory




from
The phone number that will host the conference.
Yes


callbackUrl
The complete URL where the events related to the Conference will be sent to.
No


callbackHttpMethod
Determine if the callback event should be sent via HTTP GET or HTTP POST. Values are GET or POST, default: POST.
No


callbackTimeout
Determine how long should the platform wait for callbackUrl’s response before timing out in milliseconds.  Default Time: 10000 (10s)  Maximum Time: 10000 (10s)
No


fallbackUrl
The URL used to send the callback event if the request to callbackUrl fails.
No


profile
The conference profile that determines how DTMF is used. Values are:- interpret_digits: the conference will handle DTMF with the default behavior -passthru_digits: allows the application to receive DTMF events and use the gather API.Default: interpret_digits
No


tag
A string that will be included in the callback events of the conference.
No



Example 1 of 3: Create conference call
curl -v -X POST https://api.catapult.inetwork.com/v1/users/{userId}/conferences -u {token}:{secret} -H "Content-type: application/json" -d
