methods/messages/postMessages.html.body:
Send SMS Message(s)
Sends one or more messages.


Read More about Messaging in the FAQ



Request URL
POSThttps://api.catapult.inetwork.com/v1/users/{userId}/messages

Supported Parameters



Parameter
Description
Mandatory




from
One of your telephone numbers the message should come from (must be in E.164 format, like +19195551212).
Yes


to
The phone number the message should be sent to (must be in E.164 format, like +19195551212).
Yes


text
The contents of the text message (must be 2048 characters or less).  Standard text messages are 160 characters. Messages larger than 160 characters are automatically fragmented and re-assembled to fit within the 160 character transport constraints.
Yes


media
For MMS messages, a media url to the location of the media or a list of media urls to be sent with the message.  Check the faq to see what media types are supported. Use SMIL  as an xml media attachment to control message presentation.  Check the faq to learn more about Toll-Free MMS
No


receiptRequested
Requested receipt option for outbound messages: none: (DEFAULT) Delivery receipt will not be sent as callback event.  all: You will get every delivery receipt for every state transition throughout the process.  Including error and success.error: Only error delivery receipt event maybe sent as callback event.  The callback will contain information about delivery   Can not send media and receiptRequested in the same request
No


callbackUrl
The server URL where the events related to the outgoing message will be sent to.
No


callbackHttpMethod
Determine if the callback event should be sent via HTTP GET or HTTP POST. Values are GET or POST, default is POST
No


callbackTimeout
Determine how long should the platform wait for callbackUrl’s response before timing out (milliseconds).  Default Time: 10000 (10s)  Maximum Time: 10000 (10s)
No


fallbackUrl
The server URL used to send the message events if the request to callbackUrl fails.
No


tag
Any string defined by you. It will be included in the callback events related to the sent message. For messages, tags do not persist beyond the request that defined the tag.
No



To send multiple text messages with 1 request, the request's data needs to be a list where each element in the list is the data for sending 1 text message. An example of this is shown underneath "Example 4".
Take note that sending multiple text messages with 1 request will not cause the text messages to be sent as a group message. Group messaging is supported with Bandwidth's V2 Messaging. More information on Bandwidth's V2 Messaging can be found here.
Multiple Message Result Types
Important Note on Multiple Messages: There is a maximum limit of 50 messages sent per multiple messages request.



Type
Description




result
Values areaccepted - the message was accepted and the location points to the message resource  error - the message was not accepted and the “error” property contains information.


location
When the result is accepted, contains the URL of the message location.





