methods/recordings/getRecordingsRecordin.body:
Fetch Recording Information
Retrieve a specific call recording information in JSON format, identified by recordingId. For more details on how to retrieve the recorded media file, please access Media documentation.
See the faq for more information about Recordings and storage.
Request URL
GEThttps://api.catapult.inetwork.com/v1/users/{userId}/recordings/{recordingId}

Properties



Property
Description




id
The unique id of the recordings resource.


startTime
Date/time when the recording started. Timestamp follows the ISO8601 format (UTC).


endTime
Date/time when the recording ended. Timestamp follows the ISO8601 format (UTC).


call
The complete URL to the call resource this recording is associated with.


media
The complete URL to the media resource this recording is associated with.


state
The state of the recording, values are  recording  complete saving  *error



Recording States



State
Description




recording
Recording is currently active.


saving
Recording is complete but it is not available to download yet.


error
Recording could not be uploaded.


complete
Recording complete and available for downloading or playing.



